import {
  Alert,
  Button,
  Dimensions,
  Platform,
  StyleSheet,
  Text,
  View,
} from "react-native";
import React, { useState } from "react";
import Pdf from "react-native-pdf";
import { wp } from "../helper/Global/responsive";
import {
  PERMISSIONS,
  checkMultiple,
  requestMultiple,
} from "react-native-permissions";
const source = {
  uri: "data:application/pdf;base64,",
};
const PdfView = () => {
  const [TotalPages, setTotalPages] = useState(0);
  const [CurrentPage, setCurrentPage] = useState(0);

  const permission = async () => {
    const checkPermission = await checkMultiple(
      Platform.OS === "android"
        ? [
            PERMISSIONS.ANDROID.WRITE_EXTERNAL_STORAGE,
            PERMISSIONS.ANDROID.READ_EXTERNAL_STORAGE,
          ]
        : [
            PERMISSIONS.IOS.PHOTO_LIBRARY,
            PERMISSIONS.IOS.PHOTO_LIBRARY_ADD_ONLY,
          ]
    );
    if (
      checkPermission["ios.permission.PHOTO_LIBRARY"] === "denied" ||
      checkPermission["ios.permission.PHOTO_LIBRARY_ADD_ONLY"] === "denied" ||
      checkPermission["android.permission.WRITE_EXTERNAL_STORAGE"] ==
        "denied" ||
      checkPermission["android.permission.READ_EXTERNAL_STORAGE"] == "denied"
    ) {
      const requestPermission = await requestMultiple(
        Platform.OS === "android"
          ? [
              PERMISSIONS.ANDROID.WRITE_EXTERNAL_STORAGE,
              PERMISSIONS.ANDROID.READ_EXTERNAL_STORAGE,
            ]
          : [
              PERMISSIONS.IOS.PHOTO_LIBRARY,
              PERMISSIONS.IOS.PHOTO_LIBRARY_ADD_ONLY,
            ]
      );
    }
  };
  return (
    <View style={styles.container}>
      <Pdf
        source={source}
        trustAllCerts={Platform.OS === "ios"}
        onLoadComplete={(numberOfPages, filePath) => {
          setTotalPages(numberOfPages);
          console.log("number of pages:", numberOfPages);
        }}
        onPageChanged={(page, numberOfPages) => {
          setCurrentPage(page);
          console.log("current page:", page);
        }}
        onError={(error) => {
          console.log(error);
        }}
        onPressLink={(uri) => {
          console.log("Link presse:", uri);
        }}
        style={styles.pdf}
      />
      <View style={styles.infoview}>
        <Text style={styles.info}>
          {CurrentPage}/{TotalPages}
        </Text>
        <Button title={"Download"} onPress={() => {}} />
      </View>
    </View>
  );
};

export default PdfView;

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: "flex-start",
    alignItems: "center",
    marginTop: 25,
  },
  pdf: {
    flex: 1,
    width: Dimensions.get("window").width,
    height: Dimensions.get("window").height,
  },
  infoview: {
    flexDirection: "row",
    width: wp(100),
    justifyContent: "center",
    alignItems: "center",
    padding: 10,
  },
  info: {
    fontSize: 20,
    fontWeight: "bold",
    color: "red",
  },
});
